import React from "react";

function navigationBar() {
  return (
    <div>
        <div className="NavBar">
        <ul>
            <li>Home</li>
            <li>Education</li>
            <li>Experience</li>
            <li>Projects</li>
            <li>Contact</li>
        </ul>
        </div>
    </div>
  );
}

export default navigationBar;
